import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Pokemon from './liste/Pokemons';
import './liste/style.css'

class App extends Component {
  render() {
    return (
        <div className="App">
              <h2> Pokedex</h2>
            <br></br>
            <Pokemon />
        </div>
    );
  }
}

export default App;
